// src/components/TopPost/TopPost.js
import React from 'react';
import styles from './TopPost.module.css';

const TopPost = ({ topPost }) => {
  const { img, title, text } = topPost;

  return (
    <div className={styles.topPostContainer}>
      <img src={img} alt={title} className={styles.topPostImage} />
      <div className={styles.topPostContent}>
        <h2>{title}</h2>
        <p>{text}</p>
      </div>
    </div>
  );
};

export default TopPost;
